import React from 'react';
import { Link } from 'react-router-dom';
import { useForm } from 'react-hook-form';
import { yupResolver } from '@hookform/resolvers/yup';
import * as yup from 'yup';
import { toast, ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';




const schema = yup.object().shape({
  Email: yup.string().email('Invalid email format').required('The Email Is required'),
  password: yup.string().min(8, 'At least 8 char').matches(/[A-Z]/, 'Password must have at least one uppercase letter')
  .matches(/[a-z]/, 'Password must have at least one lowercase letter')
  .matches(/[!@#$%^&*(),.?":{}|<>]/, 'Password must have at least one special character')
  .required('The Password Is required'),
});

const Login = () => {
 

  const { register, handleSubmit, formState: { errors } } = useForm({
    resolver: yupResolver(schema),
  });

  const onSubmit = async (data) => {
    try {
      const response = await fetch('https://freelancers.runasp.net/Auth/Login', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(data),
      });
      if (response.ok) {
        toast.success('The login is successfull!');
      } else if (response.status === 409) {
        toast.error('Account with this email already exists. Please use another email.');
      } else {
        toast.error('Failed to login to your account. Please try again.');
      }
    } catch (error) {
      console.error('Error:', error);
      toast.error('An error occurred. Please try again.');
    }
  };

  return (
    <div className='MainSignup'>

      <div className="header">
        <div className='first-head'>
          <span className='Tech'>Tech Titans</span>
          <Link to="" className='signup-head'>Login</Link>

        </div>

        <div>
          <Link to="" className='Tech contact'>Contact-Us</Link>
        </div>

      </div>

      <div className="formContent">
        <div>
          <img src="" alt="" className='ironMan'></img>
        </div>

        <div className='mainForm'>
          <h2>Login To Your Account</h2>
          <p className='underButton'> See what is going on with your business</p>

          <button className='button-google'>
            <img src="src/assets/search.png" alt=""></img>
            <div className="green-circle"></div>
            Continue with Google
          </button>
          <p className='signEmail'>------------ or Sign Up with Email ------------</p>


          <form className="FormDesign" onSubmit={handleSubmit(onSubmit)}>

            <div className="formList">
              <label>Email</label>
              <input type="Email"  {...register("Email")} placeholder="mail@abc.com" className='button-google'></input>
              {errors.Email && <p className='error'>{errors.Email.message}</p>}
              <label>Password</label>
              <input type="password" {...register('password')} placeholder="***********" className='button-google'></input>
              {errors.password && <p className='error'>{errors.password.message}</p>}

              <div className='ForgotPass'>
                <div>
                  <input type='Checkbox'></input>
                  <label>Remember Me</label>
                </div>
                <Link to='/forgot'>Forgot Password?</Link>
              </div>

            </div>


            <button className='button-google lastButton'>Login</button>
          </form>
          <div className='HaveAccount'>
            <p>Not Registered Yet?<Link to='/'>Create an account</Link></p>
          </div>
        </div>

      </div>
    </div>
  );
}

export default Login;
